import Link from 'next/Link'

const Nav = () => {
    return (
        <div>
            <Link href="/">
                <a className="home">Home</a>
            </Link>
            <Link href="/about">
                <a className="about">About</a>
            </Link>
        </div>
    )
}

export default Nav;
